  false,\n\t\"url\": null,\n\t\"notes\": \"These inland electronic Navigational charts
  (IENCs) were developed from available data used in maintenance of Navigation channels.
  Users of these IENCs should be aware that some features and attribute information
  could have significant inaccuracies due to changing waterway conditions, inaccurate
  source data, or approximations introduced during chart compilation. Caution is urged
  in use of these IENCs or derived products for Navigational planning or operation,
  or any decisions pertaining to or affecting safety of vessel operation. These initial
  IENCs are not to be used as replacements for official government chart books, as
  required in the U.S. Code of Federal Regulations.\",\n\t\"license_title\": \"License
